"use strict";$(document).ready(function(){var n=$(".js-ajax-form"),t=$("#content-area");n.on("click",":submit",function(i){i.preventDefault();post(n,t,initializeCarousel)})});var post=function(n,t,i){var r=n.find("#validation-area");$.ajax({type:"POST",url:n.attr("action"),data:n.serialize(),dataType:"json",success:function(u){u.success?(r.html(""),t.html(u.payload),i()):n.html(u.payload)},error:function(n){t.html(n)}})},initializeCarousel=function(){$("#image-carousel").carousel()};